import React from 'react';

function ForumTopic() {
    return (
        <div className="forum-topic">
            <h2>Topic Title</h2>
            <p>Discussion and posts related to this topic.</p>

            <div className="posts-list">
                <div className="post-item">
                    <p><strong>User1:</strong> This is the first post on this topic.</p>
                </div>
                <div className="post-item">
                    <p><strong>User2:</strong> Here is another post.</p>
                </div>
            </div>

            <div className="post-form">
                <textarea placeholder="Write a comment..."></textarea>
                <button>Post</button>
            </div>
        </div>
    );
}

export default ForumTopic;
